CREATE FUNCTION public.calculate_quality_score(metadata_xml text) RETURNS double precision
    LANGUAGE plpgsql
    AS $$
DECLARE
    score float := 0.0;
    max_score float := 100.0;
    weights jsonb := '{
        "title": 10,
        "abstract": 15,
        "spatial_extent": 20,
        "temporal_extent": 15,
        "keywords": 10,
        "contact": 15,
        "distribution_info": 15
    }'::jsonb;
    xml_doc xml;
BEGIN
    -- Parse XML and register namespaces
    xml_doc := metadata_xml::xml;
    
    -- Check title
    IF xpath_exists('//*[local-name()="citation"]/*[local-name()="CI_Citation"]/*[local-name()="title"]/*[local-name()="CharacterString"]', xml_doc) THEN
        score := score + (weights->>'title')::float;
    END IF;

    -- Check abstract
    IF xpath_exists('//*[local-name()="identificationInfo"]/*[local-name()="MD_DataIdentification"]/*[local-name()="abstract"]/*[local-name()="CharacterString"]', xml_doc) THEN
        score := score + (weights->>'abstract')::float;
    END IF;

    -- Check spatial extent
    IF xpath_exists('//*[local-name()="EX_GeographicBoundingBox"]', xml_doc) THEN
        score := score + (weights->>'spatial_extent')::float;
    END IF;

    -- Check temporal extent
    IF xpath_exists('//*[local-name()="temporalElement"]/*[local-name()="EX_TemporalExtent"]', xml_doc) THEN
        score := score + (weights->>'temporal_extent')::float;
    END IF;

    -- Check keywords
    IF xpath_exists('//*[local-name()="descriptiveKeywords"]/*[local-name()="MD_Keywords"]/*[local-name()="keyword"]', xml_doc) THEN
        score := score + (weights->>'keywords')::float;
    END IF;

    -- Check contact
    IF xpath_exists('//*[local-name()="contact"]/*[local-name()="CI_ResponsibleParty"]', xml_doc) THEN
        score := score + (weights->>'contact')::float;
    END IF;

    -- Check distribution info
    IF xpath_exists('//*[local-name()="distributionInfo"]/*[local-name()="MD_Distribution"]', xml_doc) THEN
        score := score + (weights->>'distribution_info')::float;
    END IF;

    RETURN (score / max_score) * 100;
END;
$$;


